## Category Theory

<aside class="notes"><p>This is a very short introduction to category theory focused on the base concepts for understanding the nature of abstract data types and how the underlying patterns are derived. It&#39;s by all means not complete; it misses some very important things in category theory and it most probably sacrifices formal correctness for ease of understanding.</p>

<aside class="notes"><p>A category is composed by a (possibly infinite) set of objects and directed arrows linking them. Some conditions related to composition are necessary for such a structure to be considered as a category:</p>
<ul>
<li>Every object $A$ must have an identity arrow called $id_A$ starting and ending in itself;</li>
<li>Every time we have three (possibly non-distinct) objects $A$, $B$ and $C$ and arrows $f: A \rightarrow B$ and $g: B \rightarrow C$, there must exist the arrow from $A$ to $C$ called $f‚àòg$. This is called the composition of $f$ and $g$;</li>
<li>The identity arrow must be the unit of composition;</li>
<li>Composition must be associative.</li>
</ul>
<p>The equality of arrows is different for different categories: apart from what the laws of categories tell us, we can&#39;t compare them directly.</p>
</aside></script></section><section  data-markdown><script type="text/template">

<aside class="notes"><p>In the <strong>Set</strong> category, objects are sets of elements and arrows are functions between them. Identity and composition are trivially defined.</p>
<p>The concept of category is a kind of abstraction layer over the operations typically defined on sets. It allows us to use what we know from math in other domains, as long as their structure fits a category.</p>

<aside class="notes"><p>The <strong>Hask</strong> category is the category of Haskell types. Objects are types (which can be seen as sets of instances) and arrows are Haskell functions.</p>
<p>Due to the nature of computing and the impossibility of detecting (and thus disallowing) non-terminating programs, there must exist an extra &quot;bottom&quot; instance in each type. Theoretically, this presents many issues; in practice, we can ignore that aspect and treat <strong>Hask</strong> just like <strong>Set</strong>.</p>
</aside></script></section><section  data-markdown><script type="text/template">

## **Hask** Category

```haskell
id :: a -> a
id x = x

compose :: (b -> c) -> (a -> b) -> (a -> c)
compose g f x = g (f x)
-- compose g f = g . f
-- compose = (.)
```

## Universal Constructions

- Patterns of relationships between objects
- Allows reusing laws from one category in others
- A balance of precision and recall
  1. pick a pattern and look for all its occurrences
  2. rank the hits and pick the best fit

<aside class="notes"><p>The first universal construction is that of an object with arrows for every other object. There&#39;s no guarantee that such an object exists (which is OK), but there can be too much. If we restrict our pattern to require the initial object to have a <em>unique</em> arrow from it to each object in the category, such an object is now unique up to isomorphism (which is explained later).</p>

## Initial Object

- The object is called $0$
- The unique arrow $0 \rightarrow A$ is called $0_A$
- The empty set is an initial object in **Set**
- Any empty type (such as `Void`) is an initial object in **Hask**

<aside class="notes"><p>By reversing all arrows in the initial object pattern, we have a terminal object - one object with an unique arrow pointing from each object of the category to itself.</p>
</aside></script></section><section  data-markdown><script type="text/template">

## Terminal Object


- The object is called $1$
- The unique arrow $A \rightarrow 1$ is called $1_A$
- Any singleton set is a terminal object in **Set**
- Any type with a single instance (such as `()`) is a terminal object in **Hask**

<aside class="notes"><p>Note that the rules are very similar to the initial object rules.</p>
</aside></script></section><section  data-markdown><script type="text/template">

## Duality

- **C<sup>op</sup>** is a category obtained by keeping all objects and reversing the arrows of category **C**
- Automatically a category:
  - $id^{op} = id$
  - If $h = g‚àòf$, then $h^{op} = f^{op}‚àòg^{op}$

</script></section><section  data-markdown><script type="text/template">

## Duality

- Constructions in the opposite category are prefixed with "co" ‚Äì coproducts, comonads, colimits...
- **C<sup>op</sup>** may be equal to **C** (not in **Set** and **Hask**)
- The terminal object is an initial object in the opposite category!

</script></section><section  data-markdown><script type="text/template">

## Isomorphism

- In universal constructions, the "shape" is the key
- It's enough to have a one-to-one mapping between objects
- In category theory, such a mapping is a pair of arrows, one being the _inverse_ of the other

</script></section><section  data-markdown><script type="text/template">

- $f: A \rightarrow B$ is an isomorphism iff there is an arrow $f^{-1}: B \rightarrow A$ such that:
  - $f^{-1}‚àòf = id_A$
  - $f‚àòf^{-1} = id_B$

</script></section><section  data-markdown><script type="text/template">

## Isomorphism

- Two initial objects must be isomorphic:
  - Let $0^A$ and $0^B$ be two initial objects with arrows $0^A_C: 0^A \rightarrow C$ and $0^B_C: 0^B \rightarrow C$ for every $C$
  - $0^A_{0B} ‚àò 0^B_0A$ is an arrow $0^A \rightarrow 0^A$ <!-- .element: class="fragment" -->
  - But there can be only one arrow from $0^A$ to any other object, and we already have $id_A$! <!-- .element: class="fragment" -->
- No need to show the same thing for the terminal object! <!-- .element: class="fragment" -->

## Products

- Goal: generalize the notion of a cartesian product of sets
- First idea:
  - three objects: $A \times B$ is the product object of $A$ and $B$
  - two arrows, $outl: A \times B \rightarrow A$ and $outr: A \times B \rightarrow B$, extracting the first and the second component

## Products

```haskell
outl :: (Int, Bool) -> Int
outl (x, b) = x

outr :: (Int, Bool) -> Bool
outr (x, b) = b
```

<aside class="notes"><p>We can show that the type <code>(Int, Bool)</code> is a valid product of <code>Int</code> and <code>Bool</code> according to our first definition by showing the <code>outl</code> and <code>outr</code> arrows for it.</p>
</aside></script></section><section  data-markdown><script type="text/template">

## Products

```haskell
outl :: Int -> Int
outl x = x

outr :: Int -> Bool
outr _ = True
```

<aside class="notes"><p>However, the definition also allows less suitable types to work as products, such as <code>Int</code> and <code>(Int, Int, Bool)</code>.</p>
</aside></script></section><section  data-markdown><script type="text/template">

## Products

```haskell
outl :: (Int, Int, Bool) -> Int
outl (x, _, _) = x

outr :: (Int, Int, Bool) -> Bool
outr (_, _, b) = b
```

</script></section><section  data-markdown><script type="text/template">

## Products

- Need to rank candidates
- Idea: find an arrow between candidates that reconstructs one in function of the other
- Let $P$ and $Q$ be two candidates for a product with arrows $outl_P$, $outr_P$, $outl_Q$ and $outl_Q$:
  - $P$ is "better" than $Q$ iff there exists an **unique** arrow $m: Q \rightarrow P$ such that $outl_Q = outl_P‚àòm$ and $outr_Q = outr_P‚àòm$
  - Similiar to factorization in mathematics

</script></section><section  data-markdown><script type="text/template">

## Products

- Is `(Int, Bool)` better than `Int`?

```haskell
m :: Int -> (Int, Bool)
m x = (x, True)
```

- Is `Int` better than `(Int, Bool)`?

```haskell
m :: (Int, Bool) -> Int
-- m (x, b) = ???
```

<aside class="notes"><p>Using our new ranking method, we show that neither <code>Int</code> nor <code>(Int, Int, Bool)</code> have suitable factorization functions to <code>(Int, Bool)</code>.</p>
<p>As <code>Int</code> cannot hold all the information in <code>(Int, Bool)</code>, there is no suitable function.</p>
</aside></script></section><section  data-markdown><script type="text/template">

## Products

- Is `(Int, Bool)` better than `(Int, Int, Bool)`?

```haskell
m :: (Int, Int, Bool) -> (Int, Bool)
m (x, _, b) = (x, b)
```

- Is `(Int, Int, Bool)` better than `(Int, Bool)`?

```haskell
m :: (Int, Bool) -> (Int, Int, Bool)
-- m (x, b) = (x, ???, b)
```

<aside class="notes"><p><code>(Int, Int, Bool)</code> holds too much information, resulting in the existence of multiple factorization functions (the factorization function should be unique).</p>
</aside></script></section><section  data-markdown><script type="text/template">

## Products

- With the factorization condition, every time a product exists it is unique up to a unique isomorphism
- `(a, b)` is the best match in **Hask** ‚Äì A _factorizer_ can show it:

```haskell
factorizer :: (c -> a) -> (c -> b) -> (c -> (a, b))
factorizer outl outr = \x -> (outl x, outr x)
-- factorizer outl outr x = (outl x, outr x)
```

</aside></script></section><section  data-markdown><script type="text/template">

## Coproducts

- By duality, when it exists, a coproduct is unique up to unique isomorphism
- `Either a b` is the best match in **Hask**:

```haskell
-- Either a b = Left a | Right b

factorizer :: (a -> c) -> (b -> c) -> (Either a b -> c)
factorizer inl inr (Left a) = inl a
factorizer inl inr (Right b) = inr b
```

</script></section><section  data-markdown><script type="text/template">

## Algebra of Data Types

- Most data structures in programming are built using products and coproducts
- Many properties are composable: equality, comparison, conversions...
- Treating data structures by their shape paves the way for automatic derivation

</script></section><section  data-markdown><script type="text/template">

## Algebra of Data Types

- These types are isomorphic in **Hask**:

```haskell
(String, Int, Bool)       -- String * Int * Bool

((String, Int), Bool)     -- (String * Int) * Bool

(String, (Int, Bool))     -- String * (Int * Bool)

data Contact = Contact {  -- String * Int * Bool
  name :: String,
  age :: Int,
  gender :: Bool
}

(Int, Bool, String)       -- Int * Bool * String

(Int, Bool, String, ())   -- Int * Bool * String * 1
```

<aside class="notes"><p>Products in <strong>Hask</strong> can be composed, are associative and have the terminal object as its unit. Note the similarity with the multiplication operation and the number 1.</p>
</aside></script></section><section  data-markdown><script type="text/template">

## Algebra of Data Types

- These types are isomorphic in **Hask**:

```haskell
Either (Either String Int) Bool     -- (String + Int) + Bool

Either String (Either Int Bool)     -- String + (Int + Bool)

data JsValue =                      -- String + Int + Bool
  JsString String |
  JsNumber Int |
  JsBoolean Bool

Either (Either Int Bool) String     -- (Int + Bool) + String

data JsValue2 =                     -- String + Int + Bool + 0
  JsString String | JsNumber Int |
  JsBoolean Bool | Void
```

<aside class="notes"><p>Coproducts are also composable, associative and have the initial object as its unit. Note once more the similarity with the addition operation and the number 0.</p>
</aside></script></section><section  data-markdown><script type="text/template">

## Algebra of Data Types

- **Set** and **Hask** are monoidal categories:
  - With the product as binary operation and the terminal object as unit
  - With the coproduct as binary operation and the initial object as unit
- It can be shown that every category that _has_ products and a terminal object is also a monoidal category (and the dual proposition for coproducts)

</script></section><section  data-markdown><script type="text/template">

## Algebra of Data Types

- These types are isomorphic in **Hask**:

```haskell
-- String * (Int + Bool)
(String, Either Int Bool)

-- (String * Int) + (String * Bool)
Either (String, Int) (String, Bool)
```

</script></section><section  data-markdown><script type="text/template">

## Algebra of Data Types

- These types are isomorphic in **Hask**:

```haskell
-- String * 0
(String, Void)

-- 0
Void
```

<aside class="notes"><p>Products in <strong>Hask</strong> distribute over coproducts and the initial object is the absorbing element of the product. Note once more the similarity with math.</p>
</aside></script></section><section  data-markdown><script type="text/template">

## Algebra of Data Types

- **Set** and **Hask** form a _semiring_ under the product and coproduct
- Not every category with product and coproduct monoids is a semiring

</script></section><section  data-markdown><script type="text/template">

## Algebra of Data Types

| Numbers      | Types
|--------------|--------
| $0$          | `Void`
| $1$          | `()`
| $a + b$      | <code>Either a b = Left a &#124; Right b</code>
| $a \times b$ | `(a, b)` or `Pair a b = Pair a b`
| $2 = 1 + 1$  | <code>data Bool = True &#124; False</code>
| $1 + a$      | <code>data Maybe = Nothing &#124; Just a</code>

<aside class="notes"><p>Due to all the conditions presented, types can be mapped to natural numbers. The natural number corresponds to the number of instances of the respective type.</p>
</aside></script></section><section  data-markdown><script type="text/template">

## Algebra of Data Types

- Other mathematical concepts with meaning in type theory: exponentials, infinite sums, derivatives

</script></section><section  data-markdown><script type="text/template">

## What's More?

- Functors
- Natural transformations
- Function objects
- Everything else :)

              { src: './plugin/highlight/highlight.js', async: true, callback: function() { hljs.initHighlightingOnLoad(); } },
              { src: './plugin/zoom-js/zoom.js', async: true },
              { src: './plugin/notes/notes.js', async: true },
              { src: './plugin/math/math.js', async: true }
            ];

            // default options to init reveal.js
            var defaultOptions = {
              controls: true,
              progress: true,
              history: true,
              center: true,
              transition: 'default', // none/fade/slide/convex/concave/zoom
              dependencies: deps
            };

            // options from URL query string
            var queryOptions = Reveal.getQueryHash() || {};

            var options = {"margin":0.2,"transition":"fade","center":false,"controls":false};
            options = extend(defaultOptions, options, queryOptions);
        </script>


        <script>
            Reveal.initialize(options);
        </script>
    </body>
</html>
